Information
------------------------------

Extraordinary People: The Eight-Limbed Boy
Six-year-old Deepak was born with an extra body growing out of his chest. His extra set of limbs belongs to an identical, parasitic twin that did not fully form or separate from Deepak in the womb. Now his life is in jeopardy. Every year, Deepak's extra limbs continue to grow as he does, putting more and more strain on his blood vessels, spine and heart. Doctors fear this twin is putting Deepak's life at risk and want to operate to remove it, despite the difficulties of major surgery - if, indeed, surgery is possible.

